function TestimonalCard(testimonials) {
    return (
        <div>
            <div>
                <p style={{ marginTop: 25 }}>
                    <span>&ldquo;</span>
                    {testimonials.message}
                </p>
                <p>
                    {testimonials.name}
                </p>
            </div>
        </div>
    )
}

export default TestimonalCard
